import React, { useEffect } from "react";

const App = () => {
  const date = new Date();

  const today = new Date(
    date.getHours(),
    date.getMinutes(),
    date.getMinutes(),
    date.getDay() + 1
  );
  console.log(today);
  return <div>{`${today}`}</div>;
};

export default App;
